description:
06/18/92 - Volkshaus: Zurich, Switzerland [85m]
attendance: 500 

set: Oceans, Even Flow, Why Go, Jeremy, State of Love and Trust, Improv (Love You Hate You), Black, Alive, (I&amp;#039;m Not Crazy)/Once, Footsteps, Deep, Leash, jam (Shower the People/Brass in Pocket/Meaningless), Porch, Improv/Suggestion/Garden, Rockin&amp;#039; in the Free World

PJ is in a good mood and Ed recalls last time when they played in Switzerland in a very small place with no amps and how cool it was. The &quot;Mamasan trilogy&quot; is performed and explained as follows: &quot;The next three songs ... we&amp;#039;ve never really played them together, but they go together. You wanna hear about it? I never told anybody about this before. I don&amp;#039;t wanna ruin any interpretations of the songs that you have, but it&amp;#039;s about incest and it&amp;#039;s about murder and all those good things. And if you can picture it in your mind, the third song takes place in a jail cell so this is our own little mini-opera here ...&quot; and &amp;#039;Alive&amp;#039; is played. The second song of the trilogy, &amp;#039;Once,&amp;#039; has a lead in: &quot;What you did to me, ain&amp;#039;t right ... problem child ... cuz I ain&amp;#039;t crazy. Once upon a time ...&quot; and Ed screams into a raging &amp;#039;Once.&amp;#039; And just before &quot;Footsteps,&amp;#039; &quot;So this is act three.&quot; &amp;#039;Shower the People&amp;#039; is a James Taylor cover. &amp;#039;Brass in Pocket,&amp;#039; is a Pretenders song with the lyrics revised a bit. (&quot;I&amp;#039;ll kick the fuck outta you ... I don&amp;#039;t give a fuck.&quot;) Ed refers to &amp;#039;Suggestion&amp;#039; as, &quot;... the same song my dad used to sing to me when he beat me.&quot; A great show featuring an excellent version of &amp;#039;Porch.&amp;#039;
